 activities. He typically wears flannel shirts and worn jeans, with a trusty backpack always nearby."\r\nExample output:\r\n```\r\nRugged 45-year-old male wilderness guide, weathered skin with deep creases, thick salt-and-pepper beard, piercing blue eyes, tall lean muscular build, tousled brown hair, outdoorsy appearance, wearing a red and black flannel shirt, worn blue jeans, sturdy hiking boots, forest green backpack, kind but reserved expression, standing confidently, surrounded by towering pine trees and mountain scenery, soft golden hour lighting, earthy color palette with pops of blue, hyper-realistic photography style, capture small details like a compass hanging from neck and a topo map peeking out of pocket --ar 2:3 --s 100 --q 2 --style cinematic <custom_style>rugged outdoor adventure photography</custom_style>\r\n```\r\n\r\nTo use this prompt generator, here I provide description and any custom style preferences:\r\n\r\n<description>{description}</description>\r\n<custom_style>{custom_style}</custom_style>\r\n\r\nPlease generate a detailed Midjourney prompt based on the provided description.	0.5	1	1000
